import axios from "axios";
import TextInput from "./TextInput";

function App() {
  const handleSubmit = async (inputValue) => {
    try {
      // Make API request with input value
      const response = await axios.get(
        `https://1h9sybsqz8.execute-api.us-east-2.amazonaws.com/dev/player-stats?name=${inputValue}`
      );
      // Handle response
      console.log(response.data);
      console.log(response.data["points"]["N"]);
    } catch (error) {
      // Handle error
      console.error("Error fetching data:", error);
    }
  };
  return (
    <div className="main">
      <h1>NBA Lineup Grader</h1>
      <TextInput onSubmit={handleSubmit} />
    </div>
  );
}

export default App;
